import React from "react";


const ContactsItem = ({contact})  => {
    console.log(contact)
    return (
        <div className="contact_card">
            <h1 className="name">{contact.name}</h1>
            <h2 className="email">{contact.email}</h2>
            <h2>{contact.phone}</h2>
            <p>{contact.type}</p>
        </div>
    )    
}

export default ContactsItem;
